import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { FaStar } from 'react-icons/fa';
import './ProductDetails.css';

const ProductDetails = () => {
  const navigate = useNavigate();
  const [quantity, setQuantity] = useState(1);
  const [activeTab, setActiveTab] = useState('description');
  const product = JSON.parse(localStorage.getItem('selectedProduct'));

  const handleQuantityChange = (e) => {
    const value = parseInt(e.target.value);
    if (value > 0) {
      setQuantity(value);
    }
  };

  const relatedProducts = [
    {
      id: 1,
      name: "Smart Watch Pro",
      price: "$299.99",
      image: "https://images.unsplash.com/photo-1546868871-7041f2a55e12?w=500"
    },
    {
      id: 2,
      name: "iPhone 13",
      price: "$899.99",
      image: "https://images.unsplash.com/photo-1592750475338-74b7b21085ab?w=500"
    },
    {
      id: 3,
      name: "Wireless Earbuds",
      price: "$159.99",
      image: "https://images.unsplash.com/photo-1590658268037-6bf12165a8df?w=500"
    },
    {
      id: 4,
      name: "Gaming Headset",
      price: "$129.99",
      image: "https://images.unsplash.com/photo-1618066346137-a904a5a4579b?w=500"
    },
    {
      id: 5,
      name: "Tablet Pro",
      price: "$649.99",
      image: "https://images.unsplash.com/photo-1561154464-82e9adf32764?w=500"
    }
  ];

  return (
    <div className="product-page">
      <nav className="top-nav">
        <div className="nav-left">
          <span className="back-arrow" onClick={() => navigate(-1)}>‚Äπ</span>
          <span>Clothes</span>
          <span>Gadgets</span>
          <span>New</span>
          <span>Featured</span>
          <span>Barter</span>
        </div>
        <div className="logo">TECHSELL</div>
        <div className="nav-right">
          <span>üîç</span>
          <span>‚öôÔ∏è</span>
          <span>üë§</span>
        </div>
      </nav>

      <div className="product-container">
        <div className="product-left">
          <div className="main-image">
            <img src={product?.image} alt={product?.name} />
          </div>
          <div className="thumbnail-row">
            <button className="nav-btn prev">‚Äπ</button>
            <div className="thumbnails">
              {[1, 2, 3, 4, 5].map((_, index) => (
                <div key={index} className="thumbnail-box"></div>
              ))}
            </div>
            <button className="nav-btn next">‚Ä∫</button>
          </div>
        </div>

        <div className="product-right">
          <h1>{product?.name}</h1>
          <div className="rating">
            <div className="stars">
              {[...Array(5)].map((_, i) => (
                <FaStar key={i} className={i < 4 ? "star-filled" : "star-empty"} />
              ))}
            </div>
            <span>(4.0)</span>
          </div>
          <div className="price">{product?.price}</div>
          
          <div className="quantity-section">
            <input 
              type="number" 
              value={quantity} 
              onChange={handleQuantityChange}
              min="1"
            />
            <button className="add-cart-btn">Add to Cart</button>
          </div>

          <div className="meta-info">
            <p>Categories: <span>Clothing, Men's Shoes</span></p>
            <p>Tag: <span>nike</span></p>
            <p>Share product</p>
          </div>
        </div>
      </div>

      <div className="tabs-section">
        <div className="tab-header">
          <button 
            className={activeTab === 'description' ? 'active' : ''}
            onClick={() => setActiveTab('description')}
          >
            Description
          </button>
        </div>
        <div className="tab-content">
          {product?.description || ""}
        </div>
      </div>

      <div className="related-section">
        <h2>Related Products</h2>
        <div className="related-grid">
          {relatedProducts.map((item) => (
            <div 
              key={item.id} 
              className="related-item"
              onClick={() => {
                localStorage.setItem('selectedProduct', JSON.stringify(item));
                navigate(`/product/${item.id}`);
              }}
            >
              <img src={item.image} alt={item.name} />
              <h3>{item.name}</h3>
              <span className="price">{item.price}</span>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default ProductDetails;
